pragma solidity ^0.4.21;

contract BancorManager {
    address owner;
    address[] addressList;
    uint256 length;

    struct BancorAddress {
        address bancorConverter;
        address smartToken;
        address ethToken;
    }

    mapping(address=>BancorAddress) addresses;
    mapping(address=>bool) managers;

    function BancorManager() public {
        owner = msg.sender;
        managers[msg.sender] = true;
        length = 0;
    }

    function AddManager(address manager) public returns (bool){
        require(msg.sender == owner);

        if (managers[manager])
        {
            return false;
        }

        managers[manager] = true;
        return true;
    }

    function deleteManager(address manager) public returns (bool){
        managers[manager] = false;
        return true;
    }

    function isManaged(address manager) public view returns (bool) {
        return managers[manager];
    }

    function addBancorAddress(address addrConverter, address addrSmartToken, address addrEthToken) public {
        require(msg.sender == owner);

        addresses[addrSmartToken] = BancorAddress(addrConverter, addrSmartToken, addrEthToken);
        length = addressList.push(addrSmartToken);
    }

    function getBancorAddresses() public returns (address[], uint256){
        require(managers[msg.sender]);

        return (addressList, length);
    }

    function getConverterAddress(address addrSmartToken) public returns (address){
        require(managers[msg.sender]);

        return addresses[addrSmartToken].bancorConverter;
    }

    function getEthTokenAddress(address addrSmartToken) public returns (address){
        require(managers[msg.sender]);

        return addresses[addrSmartToken].ethToken;
    }
}
